import * as React from 'react';
import { Heading, Box, Center } from '@chakra-ui/react';
import { StyleSheet } from 'react-native';

export default function App() {
    return (
        <Center>
        <Box>
        <Heading> 
        Hi there!
        </Heading>
        </Box>
        </Center>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
